window.jsPDF = window.jspdf.jsPDF;
const A="data:image/png;base64,";
const IULlogo="data:image/png;base64,";
const A1="";
const A2="";
document.addEventListener("DOMContentLoaded", function () {
function generatePDF() {
    const name = document.getElementById("name").value;
    const roll = document.getElementById("enrollment").value;
    const branch = document.getElementById("branch").value;
    let submittedTo = document.getElementById("faculty").value; // Updated to take Faculty text
    const section = document.getElementById("section").value; // Get selected section
    const year = document.getElementById("Year").value; // Get selected year
    const semester = document.getElementById("Semester").value; // Get selected Semester
    let subjectName = "";
    let facultyDept = document.getElementById("facultyDept").value;
    let subjectCode=document.getElementById("subjectCode").value;
    subjectName = document.getElementById("SUBJECTNAME").value;
    
    // Determine subject name based on subject code
    const doc = new jsPDF();
    let logo=A;
    let aspectRatio;
    switch(document.querySelector('#AssignmentNumber input[type="radio"]:checked').value){
        case 'Assignment':
            logo=A;
            aspectRatio=683/119;
            break;
        case 'Assignment 1':
            logo=A1;
            aspectRatio=764/326;
            break;
        case 'Assignment 2':
            logo=A2;
            aspectRatio=744/321;


    }

    const pageWidth = doc.internal.pageSize.getWidth();
    const margin = 10; // Set margin for left and right
    const logoWidth = pageWidth - 2 * margin;
    // const aspectRatio = 683 / 119; // Aspect ratio of the logo
    const logoHeight = logoWidth /( 683 / 119);
    const gap = 40;

    // Set initial Y position and add logo
    let currentY = 30; // Initial Y position for logo

    const logoSize= pageWidth-40;
    const x=(pageWidth-logoSize) / 2;
    
    // fetch('base64Data.json')
    // .then(response => response.json())
    // .then(data => {
        doc.addImage(IULlogo, "PNG", margin, currentY, logoWidth, logoHeight);
        currentY= (doc.internal.pageSize.getHeight()- logoSize/(746/334)) / 2;
        // const logo = data.scrollHorizontal;
        doc.addImage(logo, 'PNG', x,currentY,logoSize, logoSize/(746/334), '', 'FAST');
        // })
    // .catch(error => console.error('Error loading base64 data:', error));


    // doc.addImage(Assignmentlogo, "PNG", margin, currentY, logoWidth, logoHeight);


    // Add Subject Title
    doc.setFont("times", "normal");
    currentY += gap+6; // Add space before subject title
    let xx=22;
    doc.setFontSize(xx);
    let gappy=6.5;
    // doc.text(`${subjectName}`, pageWidth / 2, currentY, null, null, "center");
    let splitSubjectName = doc.splitTextToSize(subjectName, pageWidth - 70);
    // Font size for subject title
    while(splitSubjectName.length>2){

        doc.setFontSize(xx--);
        splitSubjectName = doc.splitTextToSize(subjectName, pageWidth - 70);
        gappy-=0.25;
    }

    for (let i = 0; i < splitSubjectName.length; i++) {
        doc.text(splitSubjectName[i], pageWidth / 2+ 6, currentY, null, null, "center");
        if(i<splitSubjectName.length-1)currentY += gappy; // Move down for the next line if needed
    }
    currentY += gappy; // Add space for the next line
    doc.text(`(${subjectCode})`, pageWidth / 2, currentY, null, null, "center"); // Updated subject code
    doc.setFont("times", "normal");


    // Submitted By Section - Bottom Left Alignment
    doc.setFont("times", "normal");
    doc.setFontSize(15);
    const submittedByY = 245;
    doc.setFont("times", "bold");
    doc.text("Submitted By:", 20, submittedByY);
    doc.setFont("times", "normal");
    doc.text(`Name: ${name}`, 20, submittedByY + 10);
    doc.text(`Branch: ${branch} - ${section}`, 20, submittedByY + 17.5); // Updated to include section and group
    doc.text(`Semester / Year- ${semester}/${year}`, 20, submittedByY + 25);
    doc.text(`Enrollment No.: ${roll}`, 20, submittedByY + 32.5);

    // Submitted To Section - Bottom Right Alignment
    const submittedToY = 245;
    const submittedToX = 140;
    doc.setFont("times", "bold");
    doc.text("Submitted To:", submittedToX, submittedToY);
    doc.text(submittedTo, submittedToX, submittedToY + 10); // Updated to take Faculty text
    doc.setFont("times", "normal");
    if(facultyDept!=""){
        facultyDept='('+facultyDept+")";
        const splitDept=  doc.splitTextToSize(facultyDept, 70);
        for (let i = 0; i < splitDept.length; i++) {
            doc.text(splitDept[i],submittedToX, submittedToY + 17.5 +i*5);
            if(i<splitDept.length-1)currentY += 10; // Move down for the next line if needed
        }
    // doc.text(`(${facultyDept})`, submittedToX, submittedToY + 17.5); // Updated to take Faculty Job Title
    }

    // Save the PDF
    doc.save(`${name}_Assignment_Front_Page.pdf`); 
}



// Call the function to generate the PDF when needed (e.g., on button click)
document.getElementById("generateBtn").addEventListener("click", generatePDF);

// PDF Generate Counter Logic
let pdfCount = localStorage.getItem('pdfCount') || 0;
const counterElement = document.getElementById('pdfCounter');
if (counterElement) {
  counterElement.textContent = pdfCount;
}

const generateBtn = document.getElementById('generateBtn');
if (generateBtn) {
  generateBtn.addEventListener('click', () => {
    // Run your PDF generation logic here...

    // Increment and store counter
    pdfCount++;
    localStorage.setItem('pdfCount', pdfCount);
    if (counterElement) {
      counterElement.textContent = pdfCount;
    }
  });
}
 // Attach event listener AFTER DOM is ready
  document.getElementById("generateBtn").addEventListener("click", generatePDF);
});
